import React from "react";

import Form from "react-bootstrap/Form";
const AddNote = (props) => {
  return (
    <ul>
      <li>

          <Form.Control
            placeholder="title"
            name="item"
            value={props.item}
            onChange={props.handleInputChange}
          />

          <Form.Control
            placeholder="note"
            type="text"
            name="han"
            value={props.han}
            onChange={props.handleInputChange}
            as="textarea"
            rows={2}
          />
          {/* <input
            placeholder="Note title"
            type="text"
            className="form-control"
            name="item"
            value={props.item}
            onChange={props.handleInputChange}
          />{" "} */}

          <button className="btn btn-success mt-2" onClick={props.addinvoice}>
            {" "}
            Add
          </button>

      </li>
    </ul>
  );
};

export default AddNote;
